import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-e404',
  templateUrl: './e404.page.html',
  styleUrls: ['./e404.page.scss'],
})
export class E404Page implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<ion-content [fullscreen]="true">
  <h1>
    <p>
      Error 404! Página no encontrada.
    </p>
  </h1>

  <ion-img src="../../assets/images/e404a.png"></ion-img>

  <ion-button [routerLink]="['/home']" routerLinkActive="router-link-active" size="small" class="ion-margin-top">
    Home
  </ion-button>

</ion-content>
